import React from "react";
import { BrowserRouter, Route, NavLink } from "react-router-dom";

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          <NavLink to="/">Home</NavLink>
        </li>
        <li>
          <NavLink to="/testAPI">API</NavLink>
        </li>
        <li>
          <NavLink to="/contact">Contact</NavLink>
          </li>
      </ul>
    </nav>
  );
}

export default Navbar;
